package generate

import (
	"math/rand"
	"strings"
	"time"
	"unicode"
)

// UniqueURL returns a generated unique URL pattern of AdjectiveNounAnimal
func UniqueURL() string {

	adjective := randomize(adjectives())
	noun := randomize(nouns())
	animal := randomize(animals())
	urlCombination := strings.Join([]string{adjective, noun, animal}, " ")
	return format(urlCombination)
}

func randomize(words []string) string {
	// seed the initial randomization
	rand.Seed(time.Now().Unix() * int64(len(words)))
	return words[rand.Intn(len(words))]
}

// formats a given url
func format(url string) string {
	url = strings.Title(url)
	return removeWhitespace(url)
}

// effeciently remove white space in a string
func removeWhitespace(url string) string {
	return strings.Map(func(r rune) rune {
		if unicode.IsSpace(r) {
			return -1
		}
		return r
	}, url)
}

